    <div className='home'>
      <h1>{isAuthenticated? user['userName']:"Hello NULL"}</h1>
      {/* <video className='home-vid' src='/public/vid1.mp4' type='video/mp4' controls loop autoPlay muted/> */}
    </div>
  )
}

